package Algorithm.HackerRank.HackerRank_Special_String_Again;

// https://www.youtube.com/watch?v=fib2sRjlxuw
public class Solution {

    // Complete the substrCount function below.
    static long substrCount(int n, String str) {
        int counter = 0;

        for (int i = 0; i < n; i++) {
            for (int j = i; j < n; j++) {
                // a,a,b,a,a
                // i   j
                if (str.charAt(i) != str.charAt(j)) {
                    if (j + (j - i) < str.length() && str.substring(i, j).equals(str.substring(j + 1, j + (j - i) + 1))) {
                        counter++;
                    }

                    break;
                } else {
                    counter++;
                }
            }
        }

        return counter;
    }

    public static void main(String[] args) {
        System.out.println(Solution.substrCount(65476, ""));
    }
}
